import React from 'react';

import Layout from '../components/layout';

const Question = props => (
  <div>
    <strong>{props.question}</strong>
    <p>{props.answer}</p>
  </div>
);

class FAQ extends React.Component {
  state = {};

  render() {
    return (
      <Layout container="true">
        <h1 style={{marginBottom: '10px'}}>FAQs</h1>
        <Question
          question="Where is the after party?"
          answer="The after party will be held at the Inn on the Square at 104 East Court Avenue Greenwood, SC 29646"
        />
        <Question
          question="Where is our Wedding Registry?"
          answer={
            <p>
              Our wedding registry can be found at{' '}
              <a href="https://www.amazon.com/wedding/greg-potts-michelle-phelps-abbeville-october-2019/registry/5EGW9T4EIEYQ">
                this link
              </a>
            </p>
          }
        />
      </Layout>
    );
  }
}

export default FAQ;
